Information
------------------------------

Man-Eating Super Squid
The legendary kraken lurks in the dark, and may be headed for our shores. From fishermen killed by ravenous squid to sailors who've witnessed the epic-sized monster in the flesh, these stories show the kraken myth is all too real. Can anything stop them? 
They're vicious, intelligent, and ruthless. They're eight feet long, run in packs of a thousand, and have 40,000 teeth. Plus their population is multiplying out of control. They're called Jumbo Squid, the Red Devil, the Man-Eating Super Squid. In this incredible special, we'll explore the monstrous stories of monstrous squid attacks. From an innocent housewife to the unfortunate victims of two tragic sea disasters, we'll show the events and hunt for the truth.

